import React from 'react'
import { useEffect, useState } from 'react'
import { useNavigate } from 'react-router-dom'
import { Formik, Field, Form, ErrorMessage } from 'formik';
import moment from 'moment';
import axios from 'axios';
import { toast } from 'react-toastify';
import { attendanceInitialValues, attendanceValidationSchema } from '../../validation/authValidation';
const Attendance = () => {
  const [date, setDate] = useState(new Date());
  useEffect(() => {
    const timer = setInterval(() => {
      setDate(new Date());
    }, 1000);

    return () => {
      clearInterval(timer);
    };
  }, []);
  const navigate = useNavigate();
  useEffect(() => {

    if (!localStorage.getItem("token")) {
      navigate('/')
    }
  }, [])
  return (
    <>
      <div className='flex justify-between items-center w-full py-10 px-10'>
        <div className='text-3xl italic font-serif'>Attendance Page</div>
        <div className='text-lg italic font-mono'>Welcome user</div>
        <button className='w-[5%] bg-red-500 text-white rounded-2xl active:scale-75 active:transition-all active:ease-in'>Logout</button>
      </div>
      <div className='flex justify-center'>
        <Formik initialValues={attendanceInitialValues} validationSchema={attendanceValidationSchema}
          onSubmit={async (values, { setSubmitting, resetForm }) => {
            try {
              const url = "http://localhost:8000/api/v1/attendance"
              const response = await axios.post(url, {
                status: values.name,
                date_t: values.email,
                password: values.password,
              })
              if (response.data.success) {
                toast.success(response.data.message);
                setSubmitting(false);
                resetForm();
              }

            } catch (error) {
              toast.error(error.response.data.message);
            }
          }}
        >
          <Form>
            <p className='pb-5 text-blue-500'> Date : {moment().format('LLLL')}</p>
            <Field as='select' className="h-10 rounded-lg" name="status">
              <option value="">Select the status</option>
              <option value="1">In</option>
              <option value="2">Out</option>
            </Field>
            <button type='submit' className='w-16 bg-green-500 rounded-md text-white ml-10 h-10'>Submit</button>
          </Form>
        </Formik>

      </div>
      <div>
        <div class="flex flex-col">
          <div class="overflow-x-auto sm:-mx-6 lg:-mx-8">
            <div class="inline-block min-w-full py-2 sm:px-6 lg:px-8">
              <div class="overflow-hidden">
                <table
                  class="min-w-full text-left text-sm font-light text-surface dark:text-black">
                  <thead
                    class="border-b border-neutral-200 font-medium dark:border-white/10">
                    <tr>
                      <th scope="col" class="px-6 py-4">#</th>
                      <th scope="col" class="px-6 py-4">In</th>
                      <th scope="col" class="px-6 py-4">Out</th>
                      <th scope="col" class="px-6 py-4">Status</th>
                    </tr>
                  </thead>
                  <tbody>
                    <tr class="border-b border-neutral-200 dark:border-white/10">
                      <td class="whitespace-nowrap px-6 py-4 font-medium">1</td>
                      <td class="whitespace-nowrap px-6 py-4">Mark</td>
                      <td class="whitespace-nowrap px-6 py-4">Otto</td>
                      <td class="whitespace-nowrap px-6 py-4">@mdo</td>
                    </tr>
                    <tr class="border-b border-neutral-200 dark:border-white/10">
                      <td class="whitespace-nowrap px-6 py-4 font-medium">2</td>
                      <td class="whitespace-nowrap px-6 py-4">Jacob</td>
                      <td class="whitespace-nowrap px-6 py-4">Thornton</td>
                      <td class="whitespace-nowrap px-6 py-4">@fat</td>
                    </tr>
                    <tr class="border-b border-neutral-200 dark:border-white/10">
                      <td class="whitespace-nowrap px-6 py-4 font-medium">3</td>
                      <td class="whitespace-nowrap px-6 py-4">Larry</td>
                      <td class="whitespace-nowrap px-6 py-4">Wild</td>
                      <td class="whitespace-nowrap px-6 py-4">@twitter</td>
                    </tr>
                  </tbody>
                </table>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  )
}

export default Attendance
